World's Worst Disasters

Health-Medical Documentary hosted by Josh Cohan, published by Channel 5 in 2014 - English narration


Information
------------------------------

World's Worst Disasters
From people at the mercy of terrifying natural forces to ja w-dropping narrow escapes and death-defying acts of courage, Channel 5 presents amazing footage of dramatic events and intense danger caught on camera by the very people who found themselves in life-threatening situations but lived to tell the tale.
Two brothers put their lives at risk to rescue a four-year-old child from a burning car, a couple are terrified when a tornado tears through an airport in St Louis, a plane skids off the runway in Phuket and a couple with a baby fear for their lives when their light aircraft is forced to make an emergency landing in two feet of snow.

